import React, {Component} from 'react'
import { getParseTreeNode } from 'typescript'
import './App.css'
import Navbar from './Navbar.js';

class App extends Component {

    constructor(props) {
        super(props)
        this.state = {
            account: '0x0',
            name: 'Jure'
        }
    }

    //Our React Code
    render() {
        return (
            <div>
                <Navbar account={this.state.account} />
                <div class="text-center" style={{
                    color: "green",
                    fontSize: 72 }}>
                    <h1>Hello, World</h1>
                </div>
            </div>
        )
    }
}

export default App;
